import React, { useState } from 'react';
import Header from '../components/Header';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import CoffeeIcon from '@mui/icons-material/Coffee';
import FastfoodIcon from '@mui/icons-material/Fastfood';
import LocalBarIcon from '@mui/icons-material/LocalBar';
import InputAdornment from '@mui/material/InputAdornment';
import { useNavigate } from 'react-router-dom';
import ExpenseFinder from '../apis/ExpenseFinder';

function AddExpense() {
  const [coffeeAmount, setCoffeeAmount] = useState('');
  const [foodAmount, setFoodAmount] = useState('');
  const [alcoholAmount, setAlcoholAmount] = useState('');

  const [error, setError] = useState({
    coffee: '',
    food: '',
    alcohol: '',
    form: '',
    success
  });

  const navigate = useNavigate();

  const handleSubmit = async (event: React.MouseEvent<HTMLButtonElement>) => {
    event.preventDefault();
    setError({ coffee: '', food: '', alcohol: '', form: '' });
    const userIds = [
      91235, 93430, 5963, 29926, 67471,
      36235, 8122, 85641, 88791, 39853
    ];
    const expenseTypeIds = {
      Food: 1,
      Coffee: 2,
      Alcohol: 3
    };
    const randomIndex = Math.floor(Math.random() * userIds.length);
    const randomUserId = userIds[randomIndex];
    //sel randomuserId to localstorage
    localStorage.setItem('userId', randomUserId.toString());

    try {
      const response = await ExpenseFinder.post('/', {
        expenses: [
          { type_id: expenseTypeIds.Food, amount: foodAmount },
          { type_id: expenseTypeIds.Coffee, amount: coffeeAmount },
          { type_id: expenseTypeIds.Alcohol, amount: alcoholAmount }
        ],
        user_id: randomUserId,
      });
      setCoffeeAmount('');
      setFoodAmount('');
      setAlcoholAmount('');
      console.log(response);
    } catch (err) {
      console.error(err);
      setError(prev => ({ ...prev, form: 'Failed to add expenses. Please try again.' }));
    }
  };

  return (
    <Box m={2} >
      <Header text='How much did I spend today?' />
      <Box component="form" sx={{ maxWidth: 400 }}>

        <Box my={2}>
          <TextField
            fullWidth
            error={!!error.coffee}
            helperText={error.coffee}
            id="outlined-controlled"
            label="Coffee"
            value={coffeeAmount}
            onChange={(event: React.ChangeEvent<HTMLInputElement>) => {
              const { value } = event.target;
              if (value === '' || (value.match(/^\d+$/) && Number(value) >= 1 && Number(value) <= 100)) {
                setCoffeeAmount(value);
                setError(prev => ({ ...prev, coffee: '' })); // Clears error if input is valid
              } else {
                setError(prev => ({ ...prev, coffee: 'Please enter a number between 1 and 100' }));
              }
            }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <CoffeeIcon />
                  $
                </InputAdornment>
              ),
            }}
          />
        </Box>
        <Box my={2}>
          <TextField
            fullWidth
            error={!!error.food}
            helperText={error.food}
            id="outlined-controlled"
            label="Food"
            value={foodAmount}
            onChange={(event: React.ChangeEvent<HTMLInputElement>) => {
              const { value } = event.target;
              if (value === '' || (value.match(/^\d+$/) && Number(value) >= 1 && Number(value) <= 100)) {
                setFoodAmount(value);
                setError(prev => ({ ...prev, food: '' })); // Clears error if input is valid
              } else {
                setError(prev => ({ ...prev, food: 'Please enter a number between 1 and 100' }));
              }
            }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <FastfoodIcon />
                  $
                </InputAdornment>
              ),
            }}
          />
        </Box>
        <Box my={2}>
          <TextField
            fullWidth
            error={!!error.alcohol}
            helperText={error.alcohol}
            id="outlined-controlled"
            label="Alcohol"
            value={alcoholAmount}
            onChange={(event: React.ChangeEvent<HTMLInputElement>) => {
              const { value } = event.target;
              if (value === '' || (value.match(/^\d+$/) && Number(value) >= 1 && Number(value) <= 100)) {
                setAlcoholAmount(value);
                setError(prev => ({ ...prev, alcohol: '' })); // Clears error if input is valid
              } else {
                setError(prev => ({ ...prev, alcohol: 'Please enter a number between 1 and 100' }));
              }
            }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <LocalBarIcon />
                  $
                </InputAdornment>
              ),
            }}
          />
        </Box>
        <Box my={2} display="flex" justifyContent="space-between">
          <Button variant="outlined" onClick={() => navigate('/')}>Back</Button>
          <Button color="primary" variant="contained" type='submit' onClick={handleSubmit}>Add expenses</Button>
        </Box>
      </Box>
      {error.form && <span>{error.form}</span>}
    </Box>
  );
}

export default AddExpense;
